import React, { Component } from 'react';
import './app.scss';
import { Content } from 'carbon-components-react';
import ActionsHeader from './components/ActionsHeader/ActionsHeader';
import Sidebar from './components/Sidebar';

import { Route, Switch } from 'react-router-dom';
import OverviewPage from './content/OverviewPage/';
import EngagementPage from './content/EngagementPage';
import RecognitionPage from './content/RecognitionPage';
import ContainmentPage from './content/ContainmentPage';
import NotRecognizedPage from './content/NotRecognizedPage';

class App extends Component {
  render() {
    return (
      <>
        <ActionsHeader/>
        <Sidebar/>
        <Content>
          <Switch>
            <Route exact path="/" component={OverviewPage} />
            <Route path="/engagement" component={EngagementPage} />
            <Route path="/recognition" component={RecognitionPage} />
            <Route path="/containment" component={ContainmentPage} />
            <Route path="/not-recognized" component={NotRecognizedPage} />
          </Switch>
        </Content>
      </>
    );
  }
}

export default App;
